import React, { Component, useState } from 'react';
import Game from './Game';
import gameicon from './game.png';
import '../App.css';

function Room(props) {
    return(
        <div className="App">
            <header className="App-header">
                <img src={gameicon} />
                <p>
                    Hello!! &nbsp;
                    {props.value} player
                </p>
                <form>
                    <input placeholder="Enter playroom..."/>
                    &nbsp;<button>Play</button>
                </form>
            </header>
        </div>
    )
}

export default Room;
